function jqxBrowser() {
    var ua = navigator.userAgent.toLowerCase();

    var match = /(chrome)[ \/]([\w.]+)/.exec(ua) ||
        /(webkit)[ \/]([\w.]+)/.exec(ua) ||
        /(opera)(?:.*version|)[ \/]([\w.]+)/.exec(ua) ||
        /(msie) ([\w.]+)/.exec(ua) ||
        ua.indexOf("compatible") < 0 && /(mozilla)(?:.*? rv:([\w.]+)|)/.exec(ua) ||
        [];

    var obj = {
        browser: match[1] || "",
        version: match[2] || "0"
    };
    if (ua.indexOf("rv:11.0") >= 0 && ua.indexOf(".net4.0c") >= 0) {
        obj.browser = "msie";
        obj.version = "11";
        match[1] = "msie";
    }
    if (ua.indexOf("edge") >= 0) {
        obj.browser = "msie";
        obj.version = "12";
        match[1] = "msie";
    }
    obj[match[1]] = match[1];
    return obj;
}
